import React from 'react';
import Navbar from '../components/Navbar';

function SearchBook() {
  return (
    <div>
    <Navbar />
    <h2>SearchBook Page</h2>
    <Link to="/SearchBook">
        <button>Go to Search Book</button>
    </Link>
		
      
    </div>
  );
}

export default SearchBook;
